import React, { Component } from 'react';
import axios from 'axios';


const plan = (props) => (
  <article className="Plan" onClick={props.clicked}>
  <h1>{props.legal}</h1>
  <div className="Info">
    <div className="Something">{props.economical}</div>
  </div>
  </article>
);


export default plan;
